"use strict";var initSidebar=function(i){var n=$(i),t=$(".main"),r=n.children(".btn-sidebar-close"),e=$(".btn-sidebar-open").filter(function(i,t){return $(t).data("target-by-id").replace("#","")===n.attr("id")});r.on("click",function(){n.css({width:0}),t.css("margin-left","0px")}),e.on("click",function(){n.css({width:"250px"}),t.css("margin-left","250px")})};$(document).ready(function(){$(".sidebar").on("init",function(i){initSidebar(i.target)}),$(".sidebar").trigger("init")});